import React from 'react';
import './App.css';
// import { Button } from 'react-bootstrap';

function App() {
  return (

    <div className="App">
      <table className='table'>
        <tr></tr>
        <tr>
          <td>1</td>
          <td>2</td>
          <td>3</td>
          <td>+</td>
        </tr>
        <tr>
          <td>4</td>
          <td>5</td>
          <td>6</td>
          <td>-</td>
        </tr>
        <tr>
          <td>7</td>
          <td>8</td>
          <td>9</td>
          <td>*</td>
        </tr>
      </table>
    </div>
  );
}

export default App;
